// A component that displays a single tea item
import { Col, Row } from 'antd';

function TeaItem() {
    return (
        <div className="block teaItems">
            <h2>Tea Items</h2>
            <Row gutter = {24}>
                {
                bakeryData.map(item => {
                    return(
                        <Col lg = {4}>
                        <div className = "content">
                            <div className = "image">
                            <img src={item.image} />
                            </div>
                        <h3>Frozen</h3>
                        </div>
                        </Col>
                    )
                })
                }

            </Row>
        </div>
    )
}

export default TeaItem;
